import React from 'react';
import ReactDOM from 'react-dom';
import GlobalStyles from "./components/globalStyles"
import App from './App';
import "./reset.css";

ReactDOM.render(
  <React.StrictMode>
    <GlobalStyles />
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
